import React from 'react'

let getId = (course) => {
    return course.id
}

let getTitle = (course) => {
    return course.title
}


const ListItem = ({course}) => {
    return (
        <div className = "search-list-item">
            <h3>{getId(course)}</h3>
            <p>{getTitle(course)}</p>
        </div>
    )
}

export default ListItem
